import React from 'react';

const middleNav = () =>{
    return(
        <React.Fragment>
        <nav>
        <div className="nav-wrapper grey lighten-5">

          <ul id="nav-mobile" style={{textAlign:'center', color:'black'}}className=" hide-on-med-and-down">
            <li><a style={{textAlign:'center', color:'black'}} href="sass.html">Sass</a></li>
            <li><a href="badges.html">Components</a></li>
            <li><a href="collapsible.html">JavaScript</a></li>
          </ul>
        </div>
      </nav>
      </React.Fragment>
    );
}

export default middleNav;
